schemaDefinition: "create or replace view U_M2M_DEPLOYMENT_APPLICATIONS(\n\t\"DplyAppDeployment\"\
  ,\n\t\"DplyAppApplication\",\n\t\"DplyAppDeploymentSysID\",\n\t\"DplyAppApplicationSysID\"\
  ,\n\t\"DplyAppDeploymentConsultant\",\n\t\"DplyAppComplexity\",\n\t\"DplyAppImplementationStatus\"\
  ,\n\t\"DplyServiceOffering\",\n\t\"DplyCustomerAppProfile\",\n\t\"DplyAppStatementOfWork\"\
  ,\n\t\"DplyAppServiceOffering\"\n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"DV_U_DEPLOYMENT\"\
  \ as \"DplyAppDeployment\",\n       \"DV_U_APPLICATION\" as \"DplyAppApplication\"\
  ,\n       \"U_DEPLOYMENT\" as \"DplyAppDeploymentSysID\",\n       \"U_APPLICATION\"\
  \ as \"DplyAppApplicationSysID\",\n       \"DV_U_DEPLOYMENT_CONSULTANT\" as \"DplyAppDeploymentConsultant\"\
  ,\n       \"DV_U_COMPLEXITY\" as \"DplyAppComplexity\",\n       \"DV_U_IMPLEMENTATION_STATUS\"\
  \ as \"DplyAppImplementationStatus\",\n       \"DV_U_SERVICE_OFFERING\" as \"DplyServiceOffering\"\
  ,\n       \"DV_U_CUSTOMER_APPLICATION_PROFILE\" as \"DplyCustomerAppProfile\",\n\
  \t\t\"DV_U_STATEMENT_OF_WORK\"  as    \"DplyAppStatementOfWork\",\n\t\t\"DV_U_SERVICE_OFFERING\"\
  \  as    \"DplyAppServiceOffering\"\n\nFROM \"RDS\".\"SURF\".\"U_M2M_DEPLOYMENT_APPLICATIONS\"\
  ;"
